import { useEffect } from "react";

function FetchUserData({ onDataFetch }) {
    useEffect(() => {
        fetch('http://localhost:8080/api/users_data/')
            .then(response => response.json())
            .then(data => {
                if(onDataFetch) {
                    onDataFetch(data);
                }
            })
            .catch(error => console.error('Error User Data:', error));
    }, [onDataFetch]);
    return null;
}

export default FetchUserData;
